import React from 'react';
import { useEffect, useState } from 'react';
import earthVid from '../assets/home-bg-video.mp4';
import Typing from 'react-typing-effect';

function Home() {
  return (
    <div className="relative">
      <video
        src={earthVid}
        alt="home bg logo"
        className="w-screen h-screen object-cover"
        autoPlay
        loop
        muted
      />
      <div className="absolute bottom-0 left-0 w-full h-full flex items-center justify-center z-10">
        <h1 className="flex font-thin font-mono text-8xl text-white">
          <Typing speed={1} cursorClassName="typing-cursor">
            Welcome
          </Typing>
        </h1>
      </div>
    </div>
  );
}

export default Home;
